    const [errorShow, setError] = useState("")
    useEffect(() => {
        const users = axios.get("https://jsonplaceholder.typicode.com/users")
        users.then((res) => {
            setData(res.data.slice(0, 4))
            setLoading(true)
        })
    }, [])
    console.log(data);
    return <div>
        {loading ? <table className="table">
            <thead>
                <tr>
                    <th scope="col">Id</th>
                    <th scope="col">Name</th>
                    <th scope="col">Email</th>
                    <th scope="col">Handle</th>
                </tr>
            </thead>
            <tbody>
                {data.map((item) => {
                    return <tr key={item.id}>
                        <th scope="row">{item.id}</th>
                        <td>{item.name}</td>
                        <td>{item.username}</td>
                        <td>{item.email}</td>
                    </tr>
                })}
